import './App.css';
import React from 'react';

function App() {

  // Define the function that you want to call.
  function logMessage() {
    var min =-45;
    var max =45;
    var randox = Math.floor(Math.random() * (max - min + 1)) + min;
    var randoy = Math.floor(Math.random() * (max - min + 1)) + min;

    console.log(document.querySelector('.invite-btn'))
    document.querySelector('.invite-btn').style.top = `${randoy}vh`;
    document.querySelector('.invite-btn').style.left = `${randox}vw`;

  }

  // Add the event listener outside of the App() function.
  document.addEventListener('DOMContentLoaded', function(){
    console.log("err");
  });

  const isMobile = /Mobi/.test(navigator.userAgent);

  if(isMobile){
    return (
      <div className="about-me-container">
        <div className="info-container">
          <div className="typewriter-container">
            <h3>My skills</h3>
          </div>
          <div id='skills-mobile'>
          <li className='code'>C++</li>
          <li className='code'>SQL</li>
          <li className='code'>HTML</li>
          <li className='code'>CSS</li>
          <li className='code'>Javascript</li>
          <li className='code'>Java</li>
          <li className='code'>Python</li>
          <li className='code'>Arm Assembly</li>
          <li className='other'>Django</li>
          <li className='other'>React</li>
          <li className='other'>SFML</li>
          <li className='other1'>DOM</li>
          <li className='other1'>OOP</li>
        </div>
        </div>
      </div>
    );
  }

  // Call the Move_btn() function with parentheses in the onMouseOver event handler.

  return (
    <div className="App">
      <header className="App-header">
        <div id="GFG">
          <button className='invite-btn' onMouseEnter={logMessage}>
            View Match
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
